import React, { Component } from 'react';
import './tr_table.css';
import ReactDataGrid from 'react-data-grid'



class Table_sample extends Component{
    render(){
        return(
            <div><ReactDataGrid
            columns = {this.props.Date}
            rowGetter={i => this.props.Name[i]}
            rowCount={3}/></div>
        )
    }
}

export default Table_sample;
